import React from "react";
import Parser from 'html-react-parser';

export default ({ data, text }) => {

  const modText = Parser(data.text, {
    replace: (domNode) => {
      if (domNode.name === 'embed') {
        console.log("******");
        console.log(domNode.attribs.id);
        console.log(data.media[domNode.attribs.id].embed)
        return data.media[domNode.attribs.id].embed;
      }
    }
  });

  //console.log(data.media)
  return (
    <div className="news1">
      <hr />
      <h1>{data.title} </h1>
      <div>{modText}</div>
    </div>
  )
};
